import store from '../../store/RootStore';
import { setStyle } from '../../utils';

interface ScrollOptions {
  container: HTMLElement;
  height?: number;
  barColor?: string;
  trackStyle?: {[key: string]: any};
  displayRange: { start: number; end: number; };
  onScroll: (range: { start: number; end: number; }) => void;
}

export default class ScrollControl {
  container: HTMLElement;

  displayRange: {start: number; end: number;};

  scrollTrack: HTMLElement;

  timeline: HTMLDivElement;

  region: HTMLElement;

  trackStyle?: {[key: string]: any};

  scrollBar: HTMLElement;

  params: {
    height: number;
    barColor: string;
    trackColor: string;
  };

  isDragging = false;

  startX = 0;

  stop: any;

  onScroll: (visible: { start: number; end: number; }) => void;

  constructor({ container, height, barColor, trackStyle, displayRange, onScroll }: ScrollOptions) {
    this.container = container;
    this.params = {
      height: height || 20,
      barColor: barColor || '#777B82',
      trackColor: trackStyle?.color || '#eee',
    };
    this.displayRange = displayRange;
    this.trackStyle = trackStyle;
    this.scrollTrack = document.createElement('div');
    this.scrollBar = document.createElement('div');
    this.timeline = document.createElement('div');
    this.region = document.createElement('div');
    this.onScroll = onScroll;
    this.init();
  }

  init() {
    const { height, barColor, trackColor } = this.params;
    this.scrollTrack.className = 'wave-scroll';
    setStyle(this.scrollTrack, {
      position: 'relative',
      width: '100%',
      height: `${height}px`,
      padding: '2px 0',
      backgroundColor: trackColor,
      borderRadius: '2px',
      overflow: 'hidden',
      ...this.trackStyle
    });
    this.scrollBar.className = 'wave-scroll-bar';
    setStyle(this.scrollBar, {
      position: 'absolute',
      width: '100%',
      minWidth: '20px',
      height: `${height - 4}px`,
      backgroundColor: barColor,
      borderRadius: '2px',
      cursor: 'pointer',
    });
    this.region.className = 'wave-scroll-region';
    setStyle(this.region, {
      position: 'absolute',
      height: '100%',
      width: '30px',
      top: 0,
      left: 0,
      opacity: '0',
      border: '1px solid #A0A8BA',
      pointerEvents: 'none',
    });
    this.timeline.className = 'wave-scroll-timeline';
    setStyle(this.timeline, {
      position: 'absolute',
      height: '100%',
      width: '1px',
      top: 0,
      left: 0,
      background: '#34CBD1',
      pointerEvents: 'none',
    });

    this.scrollTrack.appendChild(this.scrollBar);
    this.scrollTrack.appendChild(this.region);
    this.scrollTrack.appendChild(this.timeline);
    this.container.appendChild(this.scrollTrack);
    this.listen();
    this.resize();
  }

  resize() {
    if (this.scrollTrack && this.scrollBar) {
      const { clientWidth } = this.scrollTrack;
      const { start, end } = this.displayRange;
      const precent = end - start;
      let barWidth = precent * clientWidth;
      barWidth = Math.max(barWidth, 20);
      const left = start ? (start / (1 - precent)) * (clientWidth - barWidth) : 0;
      setStyle(this.scrollBar, {
        width: `${(barWidth / clientWidth) * 100}%`,
        left: `${left}px`
      });
    }
  }

  setScroll(displayRange: { start: number; end: number }) {
    this.displayRange = displayRange;
    this.resize();
  }

  listen() {
    this.scrollBar.addEventListener('mousedown', this.mouseDown);
    window.addEventListener('mousemove', this.mouseMove);
    window.addEventListener('mouseup', this.mouseLeave);
  }

  destory() {
    this.scrollBar.removeEventListener('mousedown', this.mouseDown);
    window.removeEventListener('mousemove', this.mouseMove);
    window.removeEventListener('mouseup', this.mouseLeave);
  }

  updateTimeline = () => {
    const { currentTime, duration } = store.waveform;
    setStyle(this.timeline, {
      left: `${(currentTime * 100) / duration}%`
    });
  };

  updateRegion = (_start?: number, _end?: number) => {
    const { waveform: { duration }, instance: { selectedInstance } } = store;
    const start = _start || selectedInstance?.start;
    const end = _end || selectedInstance?.end;
    if (start !== undefined && end !== undefined) {
      setStyle(this.region, {
        left: `${(start * 100) / duration}%`,
        width: `${((end - start) * 100) / duration}%`,
        opacity: '1',
      });
    } else {
      setStyle(this.region, {
        opacity: '0',
      });
    }
  };

  mouseDown = (e: MouseEvent) => {
    this.isDragging = true;
    this.startX = e.clientX;
  };

  mouseLeave = () => {
    if (this.isDragging) {
      this.isDragging = false;
    }
  };

  mouseMove = (e: MouseEvent) => {
    const { start, end } = this.displayRange;
    const precent = end - start;
    if (this.isDragging && precent < 1) {
      const movePrecent = ((e.clientX - this.startX) * (1 - precent)) / (this.scrollTrack.clientWidth - this.scrollBar.clientWidth);
      let left = movePrecent + start;
      if (left < 0) {
        left = 0;
      } else if (left + precent > 1) {
        left = 1 - precent;
      }
      this.displayRange = {
        start: left,
        end: left + precent,
      };
      this.startX = e.clientX;
      this.onScroll({
        start: left,
        end: left + precent,
      });
    }
  };
}
